function App() {
  const[todoList,setTodoList]=useState([])
  console.log(todoList)
  return (
    <>
    <div className="App">
      <TodoHeader headerContent={"Todo List"} />
      <input 
      type="checkbox"/>
      <TodoInput setTodoList={setTodoList} todoList={todoList}/>
      <TodoList todoList={todoList}/>

    </div>
    </>
  );
}

export default App;
